webpackJsonp([298],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-learn-about-ruby-arrays.json":function(e,r){e.exports={data:{markdownRemark:{html:'<h3>Basics:</h3>\n<ul>\n<li>Arrays are a list of indexed items stored inside <code>[]</code> brackets.</li>\n<li>Ruby uses zero-based indexing. This means the first item in the array is stored in index number <code>0</code>, then the second is at index number <code>1</code>, and so on incrementing by values of 1 for each additional item stored in the array.</li>\n<li>Arrays can be created using <code>[]</code> or <code>Array.new</code> syntax.</li>\n<li>Ruby has many build in methods to perform operations on arrays such as reversing or finding an element stored in the array.</li>\n</ul>\n<h2>Examples:</h2>\n<pre><code>arr = [1,2,3]\n# is equivalent to:\narr = Array.new(3)\narr[0] = 1\narr[1] = 2\narr[2] = 3\n# is also equivalent to:\narr = Array(1..3)\n# All three of these examples return:\n[1,2,3]\n</code></pre>\n<h2>References:</h2>\n<ul>\n<li><a href="http://ruby-doc.org/core-2.2.0/Array.html">The official Ruby documentation for arrays</a>.</li>\n</ul>',frontmatter:{title:"Learn About Ruby Arrays",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/learn-about-ruby-arrays/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/learn-about-ruby-arrays/"}}}});
